(18, 85, 'Lisa Rico', 'LisaRico@gmail.com', '', '42.201.169.192', '2018-05-08 13:39:13', '2018-05-08 13:39:13', 'I m tooo happy with this dress..it is same as shown in pic..love d colour nd drss too an amazng drss at low price..Happy shoppng. Love this site', 0, '1', '', 'review', 0, 0),
