(2581, 1, '2018-02-27 11:22:34', '2018-02-27 11:22:34', 'Have you started school again? Or your kids? O your kids’ kids? Or you’re the teacher? Or you work from home and you’re looking out the window to borrow some back-to-school vibes from the kiddos in backpacks walking to the bus? Back-to-school is upon us all. It sounds so basic to say that I can’t believe that it’s already that time of year – probably because it IS so basic. It’s what I say every season, every year. But with the upheaval and constant grief of this last year, time just feels especially weird. Like it’s been both too slow and too fast all at once. But as usual, time ticks on, and that is, I guess, is how you find yourself staring down the completed ravaged back-to-school section at Target wondering why the pencils are already out because didn’t summer just start? Here we go again.At its core, this is just a playful, easy five-ingredient recipe:', 'Hungs continental foods', '', 'publish', 'closed', 'closed', '', 'hungs-continental-foods', '', '', '2020-07-16 08:04:52', '2020-07-16 08:04:52', '', 0, 'https://listing.downtown-directory.com/backup/?post_type=listing&#038;p=2581', 0, 'listing', '', 2),
