(2662, 1, '2018-03-10 09:27:32', '2018-03-10 09:27:32', 'Welcome to Health Medical Rehabilitation Center. We are Offering Medical Doctors, Chiropractors, Physical Therapists, Acupuncturists, Massage Therapists, Audiologists &amp; Hearing Aid Dispensers<p><b>A Health Medical Rehabilitation Center To Wellness:</b></p><p>We treat neck and back pain * Carpal Tunnel Syndrome (pain * numbness * tingling * weakness and difficulty handling small objects and/or waking up at night with pain) * Sciatica pain (back pain - down the back of the leg) * Fibromyalgia * fatigue * stiffness * headaches * muscle &amp; joint pain * waking up tired in the morning * tender points of pain throughout the body * depression * anxiety * restlessness * bad weather causes pain to worsen * tingling sensation * numbness in arms / legs We treat hearing loss (asking for repetition * difficulty conversing on the phone * following conversation in a restaurant * hearing in the presence of background noise * hearing women or children\'s voices * hear people speak but fail to understand what they are saying * feel as though others mumble * feel stressed or tired after listening for long periods of time * withdrawing from social activities) * Tinnitus (noises in the ears like roaring * buzzing * hissing)</p><p>We are built on a foundation of experience that provides our families with the best possible outcome in their rehabilitative experiences. We are always divine to help patients 24/7.</p><p><br></p>', 'Health Medical Rehabilitation Center', '', 'publish', 'closed', 'closed', '', 'health-medical-rehabilitation-center', '', '', '2020-07-16 08:04:32', '2020-07-16 08:04:32', '', 0, 'https://listing.downtown-directory.com/backup/?post_type=listing&#038;p=2662', 0, 'listing', '', 2),
