(3593, 1, '2020-07-14 11:23:07', '2020-07-14 11:23:07', '<!-- wp:paragraph -->\n<p>Векове наред в българските народни песни се пее за омайни билета, брани по ранина от млади моми и момци… Дали магическото действие на добрите духове, населявали древния Хемус, не е създало тези омайни растения, изплели нанизи от дъхави огърлици по гори и ливади? Едно е сигурно – в тях тече живителният сок на земята на българите и затова те носят здраве и сила, красота и мъжество, любов.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Днес у нас съществува огромно богатство и разнообразие на растителни видове – около 3600. Като лечебни растения се употребяват около 650 от тях, а ежегодно се събират над 300 вида. Благодарение на разнообразните климатични и почвени условия българските билки съдържат висок процент биологично активни вещества.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В-к „Стандарт“ събра някои от най-полезните растения, разпространени по родните земи, а в края на зимата, броени дни преди природата да облече зелената си премяна, ние ви ги представяме. Ето 10-те най-лечебни билки, които могат да бъдат открити у нас.</p>\n<!-- /wp:paragraph -->', 'Разтения, които лекуват', '', 'publish', 'open', 'open', '', '%d1%80%d0%b0%d0%b7%d1%82%d0%b5%d0%bd%d0%b8%d1%8f-%d0%ba%d0%be%d0%b8%d1%82%d0%be-%d0%bb%d0%b5%d0%ba%d1%83%d0%b2%d0%b0%d1%82', '', '', '2020-07-14 11:23:07', '2020-07-14 11:23:07', '', 0, 'http://127.0.0.1/?p=3593', 0, 'post', '', 1),
